import React from 'react';

const MyComponent = () => {
    return (
        <div className="container">
            <div className="row">
                <div className="col-xl-12" style="background-color: white">
                    <p>Первая колонка</p>
                </div>
            </div>
        </div>
    );
};

export default MyComponent;
